import React, { Component } from 'react';
import Home from './Components/Home';
import LatestCollection from './Components/LatestCollection';
import './App.css';

import './SASS/main.scss';

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      location: 'home'
    };
  }

  render() {
    return (
      <div>
        <Home />
        <LatestCollection />
      </div>
    );
  }
}
